import styled from "styled-components";

const LoginButtonStyled = styled.button`
  width: 6em;
  height: 2.5em;
  border: none;
  font-size: 1em;
  font-weight: bold;
  background: black;
  color: white;
`;

export default LoginButtonStyled;
